import React from "react";
import "./Receipt.css";
import { connect } from "react-redux";
import { getFormValues } from "redux-form";

const Receipt = ({ values = { fields: [] } }) => {
  return (
    <table className="receipt-table">
      <thead className="receipt-table__head">
        <tr>
          <th>Receipt Name</th>
          <th>Receipt Source</th>
          <th>Receipt Time</th>
        </tr>
      </thead>
      <tbody className="receipt-table__body">
        {values.fields.map((n) => {
          return (
            <tr>
              <td>{n.name.value}</td>
              <td>{n.source.value}</td>
              <td>{n.time.value}</td>
            </tr>
          );
        })}
      </tbody>
    </table>
  );
};

export default connect((state) => ({
  values: getFormValues("receipt")(state),
}))(Receipt);
